import { Link } from "react-router-dom";
import Navbar from "../navbar/Navbar.jsx";
import logo from './logo.png';
import './input.css';
import backgroundImage from './hero.jpg';

function Home() {
  return (
    <div className="flex flex-col min-h-screen bg-gray-100">
      <Navbar />
      {/* Hero Section */}
      <div className="bg-gray-200 text-center py-16">
        {/* Logo Image */}
        <img src={logo} alt="Logo" className="mx-auto mb-4 w-48 h-auto" /> {/* Adjust the w-48 (width) and h-auto (height) classes as needed */}
        <h1 className="text-4xl font-bold">Connecting Chefs and Customers Worldwide</h1>

      </div>
      {/* Main Content Section */}
      <div className="flex-grow flex flex-wrap justify-between items-start p-4">
        {/* Left Container */}
        <div className="w-full md:w-1/2 p-4 bg-green-500 text-white m-2 rounded-lg">
          <h2 className="text-2xl font-bold mb-4">CHEF CONTAINER</h2>
          <div className="grid grid-cols-2 gap-4">
            {/* Smaller boxes inside the left container */}
            <div className="p-4 bg-white rounded shadow">
              <Link to="/chef">Chef 1</Link>
            </div>
            <div className="p-4 bg-white rounded shadow">
              Chef 2
            </div>
            {/* Add more boxes as needed */}
          </div>
        </div>
        {/* Right Container */}
        <div className="w-full md:w-1/2 p-4 bg-green-500 text-white m-2 rounded-lg">
          <h2 className="text-2xl font-bold mb-4">CUSTOMER CONTAINER</h2>
          <div className="grid grid-cols-2 gap-4">
            {/* Smaller boxes inside the right container */}
            <div className="p-4 bg-white rounded shadow">
              <Link to="/customer">Customer 1</Link>
            </div>
            <div className="p-4 bg-white rounded shadow">
              Customer 2
            </div>
            {/* Add more boxes as needed */}
          </div>
        </div>
      </div>  
      {/* Footer */}
      <footer className="bg-white">
        <p className="text-center text-sm text-gray-600 py-4">
          Copyright Â© 2024 by YourService.Inc.
        </p>
      </footer>
    </div>
  );
}

export default Home;
